import './assets/footer.css'

function Footer() {
    return (
        <>
        <footer>
        <section className='footer-display' id='contact'>
            <h2>Me contacter</h2>
            <p>Mon adresse e-mail : ...</p>
        </section>
        </footer>
        </>
    );
  }
  
  export default Footer;
